def check_relation(onto_query_reasoner, individual1, individual2):
    individuals = onto_query_reasoner.individuals
    individual_uris = {individual['individualLabel'].lower(): individual['uri'] for individual in individuals}

    if individual1.lower() not in individual_uris or individual2.lower() not in individual_uris:
        return "FALSE"

    uri1 = individual_uris[individual1.lower()]
    uri2 = individual_uris[individual2.lower()]

    # Check direct relations
    for individual in individuals:
        if individual['uri'] == uri1:
